type hcl_gui struct {
	window fyne.Window
	Icon fyne.Resource
	Settings *xsettings.Settings
	tabs *widget.TabContainer
	hc_hash_file *widget.Select
	hc_dictionary_attack_conf *widget.Box
	hc_combinator_attack_conf *widget.Box
	hc_mask_attack_conf *widget.Box
	hc_hybrid1_attack_conf *widget.Box
	hc_hybrid2_attack_conf *widget.Box
	hc_attack_mode *widget.Select
	hc_separator *widget.Entry
	hc_disable_monitor *widget.Check
	hc_devices_types *widget.Select
	hc_wordload_profiles *widget.Select
	hc_temp_abort *widget.Select
	hc_outfile *widget.Select
	hc_binary_file_select *widget.Select
	hc_status_timer_select *widget.Select
	hc_extra_args *widget.Entry
	hashcat hashcat
	sessions []*Session
	count_all_sessions int
	count_active_sessions int
	max_active_sessions_select *widget.Select
	max_active_sessions int
	autostart_sessions_select *widget.Select
	autostart_sessions bool
}

func (hcl_gui *hcl_gui) LoadUI(app fyne.App) {
	var hash_type_fakeselector *widget.Box
	hash_type_fakeselector = widget.NewVBox(xwidget.NewSelector("(Select one)", func(){load_hash_type_selector(hcl_gui, hash_type_fakeselector)}))
	hcl_gui.Icon = Icon
	hcl_gui.window = app.NewWindow("hashcat.launcher v"+Version)
	hcl_gui.window.SetIcon(hcl_gui.Icon)
	hcl_gui.tabs = widget.NewTabContainer(
		widget.NewTabItem("Launcher", launcherScreen(hcl_gui, hash_type_fakeselector)),
		widget.NewTabItem("Options", optionsScreen(app, hcl_gui)),
		widget.NewTabItem("Appearance", appearanceScreen(hcl_gui, hash_type_fakeselector)),
		widget.NewTabItem("About", aboutScreen()),
	)
	hcl_gui.tabs.SetTabLocation(widget.TabLocationLeading)
	hcl_gui.window.SetContent(hcl_gui.tabs)
	hcl_gui.window.SetFixedSize(true)
	hcl_gui.window.Show()
	go func() {
		time.Sleep(300*time.Millisecond)
		fake_hash_type_selector_hack(hcl_gui, hash_type_fakeselector, "(Select one)")
	}()
}

func (hcl_gui *hcl_gui) Init(app fyne.App) {
	hcl_gui.hashcat.binary_file = GetPreference_hashcat_binary_file(app)
	if _, err := os.Stat(hcl_gui.hashcat.binary_file); err == nil {
		hcl_gui.hc_binary_file_select.Selected = hcl_gui.hashcat.binary_file
		hcl_gui.hc_binary_file_select.Refresh()
	} else {
		dialog.ShowError(errors.New("Can't detect hashcat. Please specify hashcat bin/exe file"), hcl_gui.window)
		hcl_gui.tabs.SelectTabIndex(1)
	}

	hcl_gui.hashcat.args.status_timer = GetPreference_hashcat_status_timer(app)
	if hcl_gui.hashcat.args.status_timer == 0 {
		hcl_gui.hc_status_timer_select.SetSelected("Disabled")
	} else {
		hcl_gui.hc_status_timer_select.SetSelected(fmt.Sprintf("%ds", hcl_gui.hashcat.args.status_timer))
	}

	hcl_gui.hc_extra_args.SetText(GetPreference_hashcat_extra_args(app))

	hcl_gui.max_active_sessions = GetPreference_max_active_sessions(app)
	hcl_gui.max_active_sessions_select.SetSelected(fmt.Sprintf("%d", hcl_gui.max_active_sessions))

	hcl_gui.autostart_sessions = GetPreference_autostart_sessions(app)
	if hcl_gui.autostart_sessions == true {
		hcl_gui.autostart_sessions_select.SetSelected("Enable")
	} else {
		hcl_gui.autostart_sessions_select.SetSelected("Disable")
	}

	hcl_gui.Settings = xsettings.NewSettings()

	hcl_gui.count_all_sessions = 0
	hcl_gui.count_active_sessions = 0

	hashcat_init(hcl_gui)
}

func NewGUI() (*hcl_gui) {
	hcl_gui := &hcl_gui{}
	return hcl_gui
}
